from typing import List


class Solution:
    """
    Runtime: 256 ms
    https://leetcode.com/problems/largest-1-bordered-square/discuss/345233/JavaC%2B%2BPython-Straight-Forward
    """
    def largest1BorderedSquare(self, grid: List[List[int]]) -> int:
        R, C = len(grid), len(grid[0])
        top, left = [r[:] for r in grid], [r[:] for r in grid]  # r[:] array clone
        # 1. Count the number of consecutive 1s on the top and on the left.
        for i in range(R):
            for j in range(C):
                if grid[i][j]:
                    if i > 0: top[i][j] = top[i-1][j] + 1
                    if j > 0: left[i][j] = left[i][j-1] + 1

        # try from longest consecutive 1s to shortest - min(R, C) to 1,
        # check if the 1-bordered square exist.
        for l in range(min(R, C), 0, -1):
            for i in range(l-1, R):
                for j in range(l-1, C):
                    # check bottom and right are all 1s
                    # then check top and left are all 1s
                    if top[i][j] >= l and left[i][j] >= l \
                        and top[i][j-l+1] >= l and left[i-l+1][j] >= l:
                        return l ** 2
        return 0


